namespace Dhl\Express\Test\Unit\Model;

use Dhl\Express\Model\ShipmentResponse;
use PHPUnit\Framework\TestCase;

/**
 * @author   Ronny Gertler <ronny.gertler@netresearch.de>
 * @link     https://www.netresearch.de/
 */
class ShipmentResponseTest extends TestCase
{
    /**
     * @test
     */
    public function propertiesArePopulatedAndAccessible()
    {
        $labelData = '';
        $trackingNumbers = [
            1 => 'JD012959120890065400',
            2 => 'JD012959120890065401'
        ];
        $shipmentIdentificationNumber = '2324866051';
        $dispatchConfirmationNumber = 'PRG999126012345';

        $shipmentResponse = new ShipmentResponse(
            $labelData,
            $trackingNumbers,
            $shipmentIdentificationNumber,
            $dispatchConfirmationNumber
        );

        self::assertInstanceOf(ShipmentResponse::class, $shipmentResponse);
        self::assertSame($labelData, $shipmentResponse->getLabelData());
        self::assertSame($trackingNumbers, $shipmentResponse->getTrackingNumbers());
        self::assertSame($shipmentIdentificationNumber, $shipmentResponse->getShipmentIdentificationNumber());
        self::assertSame($dispatchConfirmationNumber, $shipmentResponse->getDispatchConfirmationNumber());
    }
}
